import { Col, Footer, Header, Image, Layout, Row, Sider } from 'antd';
import React from "react";

const Profile = () => {
  return (
    <Row justify="center">
      <Layout>
          <Sider>Sider</Sider>
          <Layout>
            <Header>Header</Header>
            <h1>Content</h1>
            {/* <Footer>Footer</Footer> */}
          </Layout>
        </Layout>
      <Col span={20}>
        <Image
          width={1000}
          src="http://localhost:3000/HR_employee.png"
        />
      </Col>
    </Row>
  );
};

export default Profile;
